import React, { useState } from 'react';

 import { Container, Wrapper } from './styles';
 import {Input} from "../../components/Input"
import Header from '../../components/Header';

const CreatePet: React.FC = () => {

  interface Pet {
    name: string;
    specie: string;
    age: string;
    gender:string;
    img: string;
    description:string;
  }
  const initialPetState = {
    name: "",
    specie: "",
    age: "",
    gender:"",
    img: "",
    description:""
  }
  const [pet, setPet] = useState(initialPetState);


  return (
    <>
    <Header></Header>
    <Wrapper> 
      <Container>
          <form>    
          <Input
                noMargin={false}
                onChange={() => null}
                label="Name"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Specie"
                placeholder="( CAT | DOG | BIRD | FARM | HORSE | FISH )"
            />
             <Input

                noMargin={false}
                onChange={() => null}
                label="Age"
                placeholder="( BABY | YOUNG | ADULT | SENIOR )"

            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Gender"
                placeholder="( MALE | FEMALE )"

            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Link of Image"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Description"
            />
          </form>
          </Container>
      </Wrapper>
      </>

  );
}

export default CreatePet;
